import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import ListPage from './Pages/ListPage/ListPage';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/test'>
          <ListPage/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
